import { Outlet } from "react-router-dom";

function App() {
    return (
        <div className="App">
            <Navbar />
            <Outlet />
            <Routes>
                <Route index element={<Home />} />
                <Route path="dentist" element={<Detail />} />
                <Route path="contacto" element={<Contact />} />
                <Route path="favs" element={<Favs />} />
            </Routes>
        </div>
    );
}

export default App;
